const TTableBody = (props) => {
  console.log(props.body);
  return (
    <>
      {props.body.map((row, i) => {
        return (
          <tr key={i}>
            <td>{i + 1}</td>
            <td>{row.order_number}</td>
            <td>{row.itemname}</td>
            <td>{row.sellcount}</td>
            <td>{row.sell_type}</td>
          </tr>
        );
      })}
    </>
  );
};
export default TTableBody;
